{"keybindings":"// Place your key bindings in this file to override the defaults
[
  {
    "key": "ctrl+1",
    "command": "workbench.action.focusSideBar"
  },
  {
    "key": "ctrl+1",
    "command": "workbench.action.toggleSidebarVisibility",
    "when": "sideBarFocus"
  },
  {
    "key": "enter",
    "command": "list.select",
    "when": "sideBarFocus"
  },
  {
    "key": "ctrl+shift+1",
    "command": "workbench.action.toggleActivityBarVisibility"
  },
  {
    "key": "ctrl+d",
    "command": "editor.action.copyLinesDownAction",
    "when": "editorTextFocus && !editorReadonly"
  },
  {
    "key": "ctrl+e",
    "command": "workbench.action.showAllEditorsByMostRecentlyUsed"
  },
  {
    "key": "ctrl+option+m",
    "command": "notifications.clearAll"
  },
  {
    "key": "ctrl+shift+t",
    "command": "workbench.action.terminal.toggleTerminal"
  },
  {
    "key": "ctrl+option+shift+,",
    "command": "workbench.action.toggleStatusbarVisibility"
  },
  {
    "key": "escape",
    "command": "workbench.action.focusActiveEditorGroup",
    "when": "!editorTextFocus"
  },
  {
    "key": "ctrl+n",
    "command": "explorer.newFile",
    "when": "explorerViewletFocus"
  },
  {
    "key": "ctrl+option+p",
    "command": "explorer.newFolder",
    "when": "explorerViewletFocus"
  },
  {
    "key": "ctrl+option+shift+f",
    "command": "gitlens.fetchRepositories"
  },
  {
    "key": "option+[",
    "command": "workbench.action.navigateBack",
    "when": "canNavigateBack"
  },
  {
    "key": "option+]",
    "command": "workbench.action.navigateForward",
    "when": "canNavigateForward"
  },
  {
    "key": "shift+option+t",
    "command": "extension.jumpToTest",
    "when": "editorTextFocus"
  },
  {
    "key": "ctrl+option+t",
    "command": "-extension.jumpToTest",
    "when": "editorTextFocus"
  },
  // ctrl+shit+o - navigate inside file
  // ctrl+g - jump to specific line
  {
    "key": "ctrl+b",
    "command": "-workbench.action.toggleSidebarVisibility"
  },
  {
    "key": "ctrl+b",
    "command": "editor.action.revealDefinition",
    "when": "editorHasDefinitionProvider && editorTextFocus && !isInEmbeddedEditor"
  },
  {
    "key": "ctrl+y",
    "command": "editor.action.deleteLines"
  },
  {
    "key": "shift+option+down",
    "command": "editor.action.moveLinesDownAction",
    "when": "editorTextFocus && !editorReadonly"
  },
  {
    "key": "option+down",
    "command": "-editor.action.moveLinesDownAction",
    "when": "editorTextFocus && !editorReadonly"
  },
  {
    "key": "shift+option+up",
    "command": "editor.action.moveLinesUpAction",
    "when": "editorTextFocus && !editorReadonly"
  },
  {
    "key": "option+up",
    "command": "-editor.action.moveLinesUpAction",
    "when": "editorTextFocus && !editorReadonly"
  },
  {
    "key": "option+up",
    "command": "editor.action.smartSelect.expand",
    "when": "editorTextFocus"
  },
  {
    "key": "option+down",
    "command": "editor.action.smartSelect.shrink",
    "when": "editorTextFocus"
  },
  // ctrl+shift+\ - jump to matching bracket
  // ctrl+option+up - multi cursor up
  // ctrl+option+down - multi cursor down
  {
    "key": "option+j",
    "command": "editor.action.addSelectionToNextFindMatch"
  },
  {
    "key": "option+u",
    "command": "cursorUndo",
    "when": "textInputFocus"
  },
  {
    "key": "ctrl+u",
    "command": "-cursorUndo",
    "when": "textInputFocus"
  },
  {
    "key": "option+.",
    "command": "editor.action.fixAll"
  },
  {
    "key": "option+e",
    "command": "editor.action.codeAction",
    "args": {
      "kind": "refactor.extract.function"
    }
  },
  {
    "key": "option+r",
    "command": "editor.action.refactor",
    "when": "editorHasCodeActionsProvider && textInputFocus && !editorReadonly"
  },
  {
    "key": "ctrl+shift+r",
    "command": "-editor.action.refactor",
    "when": "editorHasCodeActionsProvider && textInputFocus && !editorReadonly"
  },
  {
    "key": "ctrl+shift+g",
    "command": "workbench.view.scm",
    "when": "workbench.scm.active"
  },
  {
    "key": "ctrl+shift+g",
    "command": "-workbench.view.scm",
    "when": "workbench.scm.active"
  },
  {
    "key": "shift+ctrl+b",
    "command": "git.checkout"
  },
  {
    "key": "ctrl+k",
    "command": "extension.conventionalCommits"
  },
  {
    "key": "ctrl+shift+;",
    "command": "jump-extension.jump-to-the-start-of-a-word",
    "when": "editorTextFocus"
  },
  {
    "key": "option+q option+q",
    "command": "-jump-extension.jump-to-the-start-of-a-word",
    "when": "editorTextFocus"
  }
]
","platform":1}
